import React from 'react';
import mask from 'jquery-mask-plugin';
import $ from 'jquery';
import s from './Rent.module.css';

const Rent = () => {
    $(document).ready(() => {
        $('#phone').mask("+ 7 (999)-999-99-99");
    });

    return (
        <div className={s.cont__rend}>
            <h2 className={s.title}>Заказать оборудование</h2>
            <div>
            <label htmlFor="phone" className={s.name}>Телефон</label>
            <input type="tel" name="" id="phone" />
            <label htmlFor="name" className={s.name}>Имя</label>
            <input type="text" name="" id=""/>

            </div>
        </div>
    )
};

export default Rent;
